def hex_to_decimal(hex_string):
    try:
        decimal_value = int(hex_string, 16)
        return decimal_value
    except ValueError:
        print("Invalid hex data. Please provide a valid hex string.")
        return None

def decode_frequency_vector(hex_data):
    decoded_values = [hex_to_decimal(hex_data[i:i+2]) for i in range(0, len(hex_data), 2)]
    return decoded_values

